function createScript(js, id) {
    var s = document.createElement('script');
    if (id) s.id = id;
    s.type = 'text/javascript';
    try { s.innerHTML = js; }
    catch(e) { s.innerText = js; }
    return s;
}

function createStyle(css, id) {
    var s = document.createElement('style');
    if (id) s.id = id;
    s.type = 'text/css';
    s.textContent = css;
    return s;
}

function parseManifest(data) {
    var headers = {};
    var name, prefix, header, key, value;
    
    var endscript = "// ==/UserScript==";
    var metablock = data.substring(0, data.indexOf(endscript) + endscript.length);
    var lines = metablock.split(/\r\n|\n/).filter(function (each, index, array) {if (each.match(/\/\/ @/)) return each;});
    for (var i = 0; i < lines.length; i++) {
        [, name, value] = lines[i].match(/\/\/ @(\S+)\s*(.*)/);
        [key, prefix] = name.split(/:/).reverse();
        
        if (prefix) {
            if (!headers[prefix]) {
                headers[prefix] = new Object;
            }
            header = headers[prefix];
        } else {
            header = headers;
        }
        
        if (header[key] && !(header[key] instanceof Array)) {
            header[key] = new Array(header[key]);
        }
        
        if (header[key] instanceof Array) {
            header[key].push(value);
        } else {
            header[key] = value;
        }
    }
    
    return headers;
}

